import React from "react";
import "../../../Styles/Pages/About/AboutHeader.scss";

function AboutHeader() {
  return (
    <div className='aboutHeader'>
      <h1>About Battle Games</h1>
      <p>Making epic games for epic players</p>
    </div>
  );
}

export default AboutHeader;
